import React, { Component } from 'react';
import { GoogleMap, withScriptjs, withGoogleMap } from 'react-google-maps';

function Map(){
    return (
        <GoogleMap defaultZoom={10} defaultCenter={{ lat: 40.483011, lng: -4.087557}}>
            {planes.map((plane) => (
                <Marker key={plane.icao} position={{ lat: plane.latitude, lng: plane.longitude}}/>
                )
            )}
        </GoogleMap>
    );
}



class Test extends Component {

    constructor(props){
      super(props);
        this.state = {
          planes:[]
        }
      this.loadData = this.loadData.bind(this);
    }

    async loadData() {
        try {
            axios.get("http://localhost:8081/over").then(response => {
                this.setState({ planes: response.data })
            });
        } catch (e) {
            console.log(e);
        }
    }

    render() {
        const WrappeMap = withScriptjs(withGoogleMap(Map));
        return (
            <div >
                <WrappeMap googleMapURL={`https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places&key=AIzaSyCYtWGt6BW7bHK-u7emPPVsYWsoMUKODHI`}
                loadingElement={<div style={{ height: `100%` }} />}
                containerElement={<div style={{ height: `400px` }} />}
                mapElement={<div style={{ height: `100%` }} />}
                />
            </div>
        );
      }
}

export default Test
